  starts: 2019-08-22T17:00:00.0000000
  ends: 2019-08-22T19:00:00.0000000
  venue: Infinity Works Consulting
- name: ACCU York [Aug 2019] - A chat about C++ "issues"
  description: "<p>C++ is used by many industries, but particular members of the gaming industry have been vocal that C++ isn't evolving to solve the problems they face.</p> <p>This talk will be seeded by one such vocal outpour where C++ build times and non optimized performance are not good enough. Are they right? Do solutions exist? Is C++ evolving in the right direction?</p> "
