- name: Using Supervised ML Methods to augment intelligent dashboards in Healthcare
  description: "<p>We'll kick off the proceedings with food and soft drinks from 6:00pm - 6:30pm, followed by a talk on classification and regression in healthcare by Draped and Dash (D&amp;D)</p> <p>We at D&amp;D have developed a number of different ML classification and regression algorithms and models with the purpose of allowing healthcare services to plan for the likelihood that a patient will be stranded, to classify whether a patient will be readmitted, to predict LOS and other purposes. Our roadmap and strategy is to build intelligent dashboard that are augmented by predictive analytics and ML methods. This will allow for more effective and timely planning of demand and capacity for the healthcare industry.</p> <p>Our Stranded module is an example of how we have combined supervised ML methods - utilising regression and classification - to effectively risk stratify a patient by the likelihood that the patient will be stranded, to classify whether a patient will be stranded or not and by combining these methods with our BI solutions - this allows users to drill down to undertake descriptive analysis of the components of stranded.</p> <p>The beauty of the current module is that it contains a minimal data set that all other healthcare providers will have, making the transferrability and generalisability more fluid. Augmented dashboarding and predictive analytics is at the heart of what we do.</p> <p>Joe Frost has been working in and with the NHS for over 12 years, having began his career as an information analyst, moving on to hold the role of Head of Business Intelligence at Salford Royal for over 10 years. During his time here, Joe oversaw the trust’s integration to form The Northern Care Alliance, one of the largest healthcare organisations in Greater Manchester. Joe then moved on to become Director of Solutions and Draper &amp; Dash Healthcare, leading the<br/>company’s work around machine learning and data science.</p> <p>If you would like to volunteer for future talks, let us know!</p> <p>## What to bring</p> <p>The only requirement will be some keen listening ears!</p> "
